// import { useState } from 'react';
import './App.css';

function App() {

  const test = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://biokde.com:5000/test', {
        method: 'GET',
      })
      const data = await response.json();
      console.log(data);

    } catch (error) {
      console.log(error);
    }
  }

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    try {
      const fake_data = {
        'name': 'eric',
        'age': 20,
      }

      const response = await fetch('http://biokde.com:5000/rec', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(fake_data),
      })
      const data = await response.json();
      console.log(data);

    } catch (error) {
      console.log(error);
    }
  }

  return (
    <div className="App">
      <div>
        <p>Sample text</p>
      </div>
      <button 
        className="button"
        onClick={onSubmitHandler}
      >
        Get Recommendations!
      </button>
    </div>
  );
}

export default App;
